import logo from './logo.svg';

function App() {
  return (
    <div>
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
        Welcome to <a href="http://chmod.tech">chmod.tech</a> Something cool is being built and will be running here soon!
        </p>
      </header>
    </div>
  );
}

export default App;
